description:
Oga mot oga med Dirty Harry Callahan och en magnumrevolver finns bara en sak
att gora: halla for ogonen och hoppas han missar! Fackforeningsledaren Carmine 
Ricca star anklagad for mord. Han slapps i brist pa bevis, men friheten blir dock
kort. Bilen han fardas i stoppas av en motorcykelpolis som dodar Ricca, hans 
livvakt, hans chauffor och hans advokat. Fler och fler okanda gangsters i San
Fransisco avrattas av den mystiske motorcykelpolisen. Dirty Harry far uppdraget
att avsloja mordaren. Regisserad av Ted Post med Clint Eastwood i huvudrollen.
